import React from "react";
// import { useNavigate } from "react-router-dom";

const MainStage = ({ stage }) => {
  return (
    <div>
      <p>Main Stage</p>
      <button
        onClick={(e) => {
          e.preventDefault();
          stage = "project";
        }}
      >
        Project
      </button>
    </div>
  );
};

const ProjectStage = ({ stage }) => {
  return (
    <div>
      <p>Project Stage</p>
    </div>
  );
};

const NavBar = ({ stage }) => {
  const isMainStage = stage === "main";
  const isProjectStage = stage === "project";

  return (
    <div>
      {isMainStage && <MainStage />}
      {isProjectStage && <ProjectStage />}
    </div>
  );
};

export default NavBar;
